decision_conditions:
No development shall take place until a Construction and Environmental Management Plan has been submitted to and approved in writing by the Local Planning Authority. The Construction and Environmental Management Plan shall provide details of all methods of site preparation and construction of the development and include:

a.	traffic management (including a Construction Logistics Plan); 
b.	demolition and clearance (including wildlife exclusion fencing);
c.	site remediation and ground works;
d.	waste management (including a Site Waste Management Plan); 
e.	surface water pollution control (including protection to the River Roding);
f.	location and type of stored materials
g.	dust, smoke and odour control;
h.	avoidance of fires;
i.	wheel washing;
j.	noise and vibration;
k.	hours of operation; No demolition, construction or building works shall be carried out except between the hours of 08.00 to 18.00 Monday to Friday and 08.00 to 13.00 Saturday or at any time on Sundays, Bank or Public holidays.  Other than with the prior written approval of the Local Planning Authority, piling is to be carried out between the hours of 08.00 and 18.00 Monday to Friday only. 
l.	details of a nominated Developer/Resident Liaison Representative with an address and contact telephone number to be circulated to those residents consulted on the application by the developer's representatives. This person will act as first point of contact for residents who have any problems or questions related to the ongoing development;
m.	implementation and monitoring.  

Demolition and construction work and associated activities are to be carried out in accordance with the recommendations contained within British Standard 5228:2009, "Code of practice for noise and vibration control on construction and open sites". Parts 1 and 2.  

The Construction Management Plan shall be implemented for the entire period of the works at the site, to the satisfaction of the Local Planning Authority. 

Reason: The CEMP is required prior to commencement of development in order to minimise the impact of the construction phase on the environment and on the amenities of neighbouring residents, in accordance with Policy BP8 of the Borough Development Policies DPD (March 2011).

No above ground new development shall take place until details of the Combined Heat and Power Plant (CHP) to be installed at the premises have been submitted to and approved in writing by the Local Planning Authority.  The submitted details shall be sufficient to demonstrate that products of combustion emitted from the plant will not be prejudicial to heath or a nuisance having regard to - 
-	the position and height of the discharge flue of the combustion plant; 
-	the position and descriptions of buildings near it; 
-	the levels of the neighbouring ground; and 
-	any other matters requiring consideration in the circumstances, including but not limited to, the concentration of oxides of nitrogen in the flue gas and the flue discharge velocity.

Reason: To protect the amenity of existing and future adjoining occupiers, in accordance with Policies BR14 and BP8 of the Borough Wide Development Policies DPD (March 2011).

No above ground new development shall take place until details of hard landscaping have been submitted to and approved in writing by the Local Planning Authority.  The hard landscaping shall be designed to the Barking Code and shall include details of the following:
1.	surface materials;
2.	communal roof terraces, including details of balustrading and screening to ensure a secure and sheltered environment;
3.	play spaces and any related equipment;
4.	boundary treatment;
5.	street furniture including lighting, bollards and seating;
6.	signage and information boards (such as wayfinding);
7.	management and maintenance.

The external lighting of the development hereby permitted, is to be designed, installed and maintained so as to fully comply with The Association of Chief Police Officers - Secured by Design publication "Lighting Against Crime - A Guide for Crime Reduction Professionals", ACPO SPD, January 2011. The design shall satisfy criteria to limit obtrusive light presented in Table 1, p25 of the guide, relating to Environmental Zone E3 - Medium district brightness areas - small town centre or urban locations.  All external lighting shall be designed to prevent light spill into the River Roding watercourse.  

The hard landscaping shall be implemented in accordance with the approved details and thereafter permanently maintained, to the satisfaction of the Local Planning Authority.

Reason: In the interest of design quality, residential amenity, promoting walking and cycling, accessibility, public safety and biodiversity, in accordance with Policy CP3 of the Core Strategy (July 2010) and Policy BR3 of the Borough Wide Development Policies DPD (March 2011).
